function RoadMove(Road) {
    const shiftedRoad = [...Road];
    const firstItem = shiftedRoad.shift();
    shiftedRoad.push(firstItem);

    // Delay between each shift (in milliseconds)
    const delay = 1000;

    return new Promise((resolve) => {
        setTimeout(() => {
            resolve(shiftedRoad);
        }, delay);
    });
}

export default RoadMove;
